import axios from 'axios'
import { useEffect, useState } from 'react';
import { useDispatch } from 'react-redux';
import { ToggleButtonGroup, ToggleButton } from "@mui/material";
import { doLoadSubscriptions } from '../redux/SubscriptionsActions';
import { useSelector } from 'react-redux';
import MembersComp from './MembersComp';

const url = 'http://localhost:8000/subscriptions';

const SubscriptionsComp = () => {
    const dispatch = useDispatch()
    // const [subscriptions, setSubscriptions] = useState([])
    const subscriptions = useSelector(state => state.SubscriptionsReducer.subscriptions);
    const [currentAlignment, setCurrentAlignment] = useState("allmembers");
    // const navigate = useNavigate();
    // const [movies, setMovies] = useState([]);


    return (
        <div style={{ border: '3px solid black', width: '500px', paddingLeft: '20px'}}>
            <h2>Movies</h2>
            <br />


        <ToggleButtonGroup
          value={currentAlignment}
          onChange={(event, newAlignment) => {
            setCurrentAlignment(newAlignment);
          }} 
          exclusive
          variant="contained"
          aria-label="text formatting"
          color="primary"
          size='small'
        >
          <ToggleButton value="allmembers">All Members</ToggleButton>
          <ToggleButton value="addmember">Add Member</ToggleButton>
        </ToggleButtonGroup> {' '}
             <br /> <br />
            {currentAlignment==='allmembers'? 
            subscriptions.map((sub)=> {
                return <MembersComp key={sub.memberId} id={sub.memberId}/> 
            }) : null}
            {/* {currentAlignment==='addmember'? 
               navigate('/mainpage/addmovie') : null
        } */}
        </div>
      )
}

export default SubscriptionsComp
